import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import { Dropdown } from "bootstrap";
import { Link } from "react-router-dom";
import { useState } from "react";

import "./Header.css";

export default function Header() {

  const [isDropdownOpen, setIsDropdownOpen] = useState(false);

  const handleDropdownToggle = () => {
    setIsDropdownOpen(!isDropdownOpen);
  };
return (
    <Navbar
      variant="dark"
      expand="lg"
      className="animated-border-container animated-border"
    >
      <Container>
        <Navbar.Brand href="#home">God_&_Light</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Dropdown as={Nav.Link} onToggle={handleDropdownToggle}>
              <Dropdown.Toggle>
                Astakas <i className="fas fa-caret-down"></i> {/* Add dropdown icon */}
              </Dropdown.Toggle>
              <Dropdown.Menu show={isDropdownOpen}>
                <Dropdown.Item as={Link} to="astakas">Aaa</Dropdown.Item>
                <Dropdown.Item as={Link} to="astakas">Bbb</Dropdown.Item>
                <Dropdown.Item as={Link} to="astakas">Ccc</Dropdown.Item>
              </Dropdown.Menu>
            </Dropdown>
            <Nav.Link href="#link">Stotras</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}
